import "@openzeppelin/contracts/proxy/Clones.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "./TokenDealUpgradable.sol";

contract TokenDealFactory is Ownable {
    address public immutable tokenDealImplementation;
    address[] public allTokenDeals;
    address public tokenDealManagerAddress;
    address public tokenDealSafeAddress;

    event TokenDealCreated(address indexed tokenDeal);

    constructor(address _manager, address _safe) {
        tokenDealImplementation = address(new TokenDealUpgradable());
        tokenDealManagerAddress = _manager;
        tokenDealSafeAddress = _safe;
    }

    function setManagerAddress(address _manager) external onlyOwner {
        tokenDealManagerAddress = _manager;
    }

    function setTokenDealSafeAddress(address _safe) external onlyOwner {
        tokenDealSafeAddress = _safe;
    }

    function createTokenDeal(
        uint256 price,
        uint256 limit,
        uint32 lock,
        address _owner,
        bool _isWhiteListSale
    ) external returns (address tokenDeal) {
        tokenDeal = Clones.clone(tokenDealImplementation);
        TokenDealUpgradable(tokenDeal).initialize(
            price,
            limit,
            lock,
            tokenDealManagerAddress,
            tokenDealSafeAddress,
            _owner,
            _isWhiteListSale
        );
        allTokenDeals.push(tokenDeal);
        emit TokenDealCreated(tokenDeal);
        return tokenDeal;
    }

    function getAllTokenDeals() external view returns (address[] memory) {
        return allTokenDeals;
    }
}
