    function verifyManager(
        address _manager
    ) internal view override returns (bool) {
        return tokenDealManager == _manager;
    }

    /// @dev Set whitelsit flag
    /// @param _isWhiteListSale is sale whitelisted
    function setIsWhiteListSale(bool _isWhiteListSale) external onlyOwnerOrManager {
        isWhiteListSale = _isWhiteListSale;
    }

    /// @dev Purchase a token through a TokenDeal contract for future minting
    /// @dev payable function for non whitelisted users
    /// @notice payable function when msg.value must equal PRICE * quantity.
    /// @param amount - amount of tokens to future minting
    function purchase(uint256 amount) external payable {
        require(!isWhiteListSale, "Sale available only for whitelisted users");
        _purchase(amount, msg.sender, msg.value);
    }

    /// @dev Purchase a token through a TokenDeal contract for future minting
    /// @dev function only for private sales
    /// @notice payable function when msg.value must equal PRICE * quantity.
    /// @param amount - amount of tokens to future minting
    /// @param v - signature v
    /// @param r - signature r
    /// @param s - signature s

    function purchase(
        uint256 amount,
        uint8 v,
        bytes32 r,
        bytes32 s
    ) external payable {
        require(verify(amount, msg.sender, v, r, s), "Invalid signature");
        _purchase(amount, msg.sender, msg.value);
    }

    /// @dev Private function to purchase a token through a TokenDeal contract for future minting
    function _purchase(uint256 amount, address sender, uint256 value) private {
        if (lockTimestamp < uint32(block.timestamp)) revert TimeLockExpired();
        if ((value != nftPrice * amount) || (amount == 0))
            revert IncorrectAmount();
        if (amount > getAvailableAmount()) revert LimitExhausted();
        userBalance[sender] += amount;
        userAddress.add(sender);
        nftSold += amount;
        txBalance += TX_FEE * amount;
    }

    /// @dev Return the purchased token to withdraw the money
    /// @param amount - amount of tokens to return

    function withdrawFunds(uint256 amount) external {
        uint256 currentAmount = userBalance[msg.sender];
        if (amount > currentAmount) revert IncorrectAmount();
        if (lockTimestamp < uint32(block.timestamp)) revert TimeLockExpired();

        unchecked {
            uint256 newBalance = currentAmount - amount;
            if (newBalance == 0) {
                delete userBalance[msg.sender];
                userAddress.remove(msg.sender);
            } else {
                userBalance[msg.sender] = currentAmount - amount;
            }
            if (lockTimestamp != type(uint32).max) {
                nftSold -= amount;
            }
        }

        txBalance -= TX_FEE * amount;

        (bool sent, ) = msg.sender.call{value: amount * nftPrice}("");
        if (!sent) revert FailedToSendEther();
    }

    /// Admin/Manager methods

    /// @dev The function is designed to mint tokens after the end of the pre-sale
    /// @notice can be executed in several steps
    /// @param token - token address for minting
    /// @param gasLimit amount of residual gas at which the function terminates

    function completeSale(
        address token,
        uint32 gasLimit
    ) external onlyOwnerOrManager nonReentrant {
        if (lockTimestamp > uint32(block.timestamp))
            revert TimeLockHasNotExpiredYet();

        uint256 i = counter;
        uint256 t = totalWithdrawn;
        uint256 j = 0;
        bool loopLimit;

        while (i < userAddress.length()) {
            if (gasleft() > gasLimit) {
                // mint userTokenBalance
                j = 0;
                while (j < userBalance[userAddress.at(i)]) {
                    if (gasleft() > gasLimit) {
                        ITokenDeal(token).whitelistMint(userAddress.at(i));
                        unchecked {
                            ++j;
                            ++t;
                        }
                    } else {
                        loopLimit = true;
                        break;
                    }
                }
                userBalance[userAddress.at(i)] -= j;
                if (loopLimit) {
                    break;
                } else {
                    unchecked {
                        ++i;
                    }
                }
            } else {
                break;
            }
        }
        counter = i;
        totalWithdrawn = t;
    }

    /// @dev The function is intended to pay earnings to the owner of the collection

    function withdrawOwnerFunds() external onlyOwner {
        if (address(this).balance == 0) revert InsufficientFunds();
        if (totalWithdrawn != nftSold) revert TokensAreNotMinted();

        uint256 feeAmount = _calculateFee(
            (uint256(address(this).balance) - txBalance)
        );

        (bool sent, ) = tokenDealSafe.call{value: feeAmount + txBalance}("");
        if (!sent) revert FailedToSendEther();

        (bool sentToOwner, ) = msg.sender.call{value: address(this).balance}(
            ""
        );
        if (!sentToOwner) revert FailedToSendEther();
    }

    /// @dev The function is intended to impose sanctions on this contract on behalf of the token dial manager

    function allowRefund() external onlyManager {
        lockTimestamp = type(uint32).max;
        nftSold = nftLimit;
    }

    /// @dev The function is designed to change the time of the end of sales
    /// @param newTimestamp - new time of the end of sales

    function changeLockTimestamp(
        uint32 newTimestamp
    ) external onlyOwnerOrManager {
        if (lockTimestamp < uint32(block.timestamp)) revert TimeLockExpired();
        if (newTimestamp <= lockTimestamp)
            revert TimeMustBeHigherThanPrevious();
        lockTimestamp = newTimestamp;
    }

    function changePreMintSpots(uint256 newAmount) external onlyOwnerOrManager {
        if (newAmount <= 0) revert IncorrectAmount();
        if (newAmount <= nftSold) revert IncorrectAmount();
        nftLimit = newAmount;
    }

    /// View methods

    /// @dev Returns the amount available for purchase

    function getAvailableAmount() public view returns (uint256) {
        return nftLimit - nftSold;
    }

    /// @dev Returns the ids of the winners

    function getUserAddresses() external view returns (address[] memory) {
        return userAddress.values();
    }

    /// @dev Returns the number of winning ids

    function getUserAddressesLength() external view returns (uint256) {
        return userAddress.length();
    }

    /// @dev Calculate the percentage of a fee

    function _calculateFee(uint256 value) internal pure returns (uint256) {
        return (value * FEE) / ONE_HUNDRED_WITH_ACCURACY;
    }
}
